import React, { Component } from 'react'
import './Weekly.css'

export default class Weekly extends Component {
  constructor(){
    super()
    this.week = []
  }
  render() {
    return (
      <div className='Weeklycontainer'>
        <div className='Weeklyitems'>Complete SWE Project</div>
        <div className='Weeklyitems'>Complete SWE Project</div>
        <div className='Weeklyitems'>Complete SWE Project</div>
        <div className='Weeklyitems'>Complete SWE Project</div>
      </div>
    )
  }
}
